import React from 'react'

const About = () => {
    return (
        <div className="mb-20">
            <h1 className="sm:text-4xl text-2xl font-bold mt-6 mb-6 text-gray-900">About</h1>
            <p className="mx-auto leading-relaxed text-base mb-4">Welcome to my blog!!</p>
            <p className="mx-auto leading-relaxed text-base mb-4">So, this blog is about me. I'm Sairam Nomula, 19 years old, I'm from Khammam. I am pursuing my bachelors in Computer Science and Engineering specialized in Software Engineering at SRM University, Kattankulathur. </p>
            <p>I believe in smart-working. I'm good at leadership. My short term goal is to earn a bulk of money and get settles in USA. My long-term goal is to become a responsible, knowledgeable and a bit famous personality in a positive way among my friends.</p>
            <p>Coming to my family background: My father is a successful businessman and my mother is a homemaker. I have one sibling who is preparing for JEE-Mains. My hobbies are browsing the internet, watching movies and cooking.</p>
        </div>
    )
}

export default About
